import React, { useState } from 'react';
import { Button, Container, Typography, Box, Card, CardContent, Alert, Dialog, DialogTitle, DialogContent, DialogActions } from '@mui/material';
import VoiceInput from '../components/VoiceInput';
import { checkUserExists, verifyLogin } from '../services/api';
// Note: verifyLogin needs to be updated or split based on your preference, 
// strictly following the logic below.

const SignIn: React.FC = () => {
    const [step, setStep] = useState(1); // 1=CheckIC, 2=Verify
    const [icNumber, setIcNumber] = useState('');
    const [loginMode, setLoginMode] = useState<'voice' | 'security' | null>(null);
    const [errorPopup, setErrorPopup] = useState(false);
    const [loading, setLoading] = useState(false);

    // --- STEP 1: CHECK USER ---
    const handleCheckUser = async () => {
        if (!icNumber) return;
        setLoading(true);

        const result = await checkUserExists(icNumber);
        setLoading(false);

        if (result.success) {
            // User Exists -> Set Mode and Go to Step 2
            setLoginMode(result.mode);
            setStep(2);
        } else {
            // User DOES NOT Exist -> Show Popup
            setErrorPopup(true);
        }
    };

    // --- STEP 2: VERIFICATION UI ---
    const renderVerification = () => {
        if (loginMode === 'voice') {
            return (
                <Box sx={{ textAlign: 'center' }}>
                    <Typography color="primary" variant="h6">üé§ Voice Verification</Typography>
                    <Typography variant="body2" sx={{ mb: 2 }}>
                        Please say: "My name is [Your Name]"
                    </Typography>

                    {/* Reusing VoiceInput but conceptually this should record audio */}
                    <VoiceInput
                        label="Listening..."
                        value=""
                        onChange={() => { }} // Handle recording logic here
                    />
                    <Button variant="contained" sx={{ mt: 2 }}>Verify Voice</Button>
                </Box>
            );
        }

        if (loginMode === 'security') {
            return (
                <Box>
                    <Typography color="secondary" variant="h6">üîê Security Question</Typography>
                    <Typography variant="body2" sx={{ mb: 2 }}>
                        What is your mother's maiden name? (Example)
                    </Typography>

                    <VoiceInput
                        label="Answer"
                        value=""
                        onChange={() => { }}
                    />
                    <Button variant="contained" sx={{ mt: 2 }} fullWidth>Login</Button>
                </Box>
            );
        }
    };

    return (
        <Container maxWidth="sm" sx={{ mt: 8 }}>
            <Card sx={{ p: 3, boxShadow: 3 }}>
                <Typography variant="h4" gutterBottom align="center">MyKad Login</Typography>

                {/* STEP 1: ENTER IC */}
                {step === 1 && (
                    <Box sx={{ display: 'flex', flexDirection: 'column', gap: 2 }}>
                        <Typography>Please enter your IC Number to continue:</Typography>
                        <Button
                            variant="contained"
                            size="large"
                            onClick={handleCheckUser}
                            disabled={loading}
                        >
                            {loading ? "Checking..." : "Next"}
                        </Button>
                    </Box>
                )}

                {/* STEP 2: DYNAMIC MODE */}
                {step === 2 && (
                    <Box>
                        {renderVerification()}
                        <Button onClick={() => setStep(1)} sx={{ mt: 1 }}>Back</Button>
                    </Box>
                )}
            </Card>

            {/* ERROR POPUP (If user not found) */}
            <Dialog open={errorPopup} onClose={() => setErrorPopup(false)}>
                <DialogTitle sx={{ color: 'red' }}>User Not Found</DialogTitle>
                <DialogContent>
                    <Typography>
                        This IC Number does not exist in our system. Please check your number or register a new account.
                    </Typography>
                </DialogContent>
                <DialogActions>
                    <Button onClick={() => setErrorPopup(false)}>Close</Button>
                    <Button variant="contained" color="primary" href="/signup-step1">Register Now</Button>
                </DialogActions>
            </Dialog>
        </Container>
    );
};

export default SignIn;
